    [],nt"revision_timestamp": "2016-07-27T22:20:24.388340",nt"name": "waterbird-response-to-water-quality",nt"isopen":
    false,nt"url": null,nt"notes": "Data were collected using point count methodology
    (Bibby et al. 1992) along one, 1000 m permanent transect established at each of'
    the four sites. All species observed were quantified by year, unit, month, and transect
    point. General linear models (GLM) with unit as a nested factor and month as a repeated
    measure, were used to compare point-count data for bird species during 1995 and
    1996. A total of 79 species were observed during the 8 sample sessions combined,
    comprised of a wide range of wetland related species. Only 13, American avocet,
    American coot, American white pelican, black-crowned night-heron, cinnamon teal,
    gadwall, mallard, marsh wren, redhead, ruddy duck, western grebe, white-faced ibis,
    and yellow-headed blackbird, met the statistical requirements necessary for analysis.
    Excepting the American white pelican, all of these species commonly breed and migrate
    through the Lahontan Valley. The wetlands provide an important loafing and foraging
    area for non-, pre-, and postbreeding pelicans.",nt"license_title": "License
